// src/pages/VideoLearning.js
import React from "react";
import "../styles/vide";

const videos = [
  { id: 1, title: "Learn ABCs with Fun!", link: "https://www.youtube.com/embed/dQw4w9WgXcQ" },
  { id: 2, title: "Basic Math for Kids", link: "https://www.youtube.com/embed/lsm3p4LJtDI" },
  { id: 3, title: "Fun Science Experiments", link: "https://www.youtube.com/embed/oocSD7Ow0Ew" },
  { id: 4, title: "Story Time: The Lion & The Mouse", link: "https://www.youtube.com/embed/P1-Ra4Pps5E" }
];

const VideoLearning = () => {
  return (
    <div className="video-learning-container">
      <h1>ðŸ“º Video Learning</h1>
      <div className="video-list">
        {videos.map((video) => (
          <div key={video.id} className="video-card">
            <iframe
              width="100%"
              height="200"
              src={video.link}
              title={video.title}
              frameBorder="0"
              allowFullScreen
            ></iframe>
            <h3>{video.title}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};

export default VideoLearning;
